import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';

ReactDOM.render( 
    <App/>,
    document.getElementById('root') 
);

function header(){
    return (
        <div id="wrapper">
        <header id="header">
          <div class="logo">
              <span class="icon fa-chart-bar"></span>
          </div>
          <div class="content">
              <div class="inner">
                  <h1>Desafio Indwise</h1>
                  <p> análise exploratória de dados</p>
              </div>
          </div>
          <nav>
              <ul>
                  <li><a href="#intro">Sobre</a></li>
                  <li><a href="#work">Gráficos</a></li>
                  <li><a href="#contact">Contato</a></li>
              </ul>
          </nav>
      </header>          
    </div>
    )
}

